import React, { useState, useEffect } from "react";
import axios from "axios";

function ShowFeedback() {
  const [feedbackData, setFeedbackData] = useState([]);

  useEffect(() => {
    fetchData();
  }, []);

  const fetchData = async () => {
    try {
      const response = await fetch(
        "https://railwaymcq.com/student/dbfeedback_api.php"
      );

      if (!response.ok) {
        throw new Error("Failed to fetch data");
      }
      const data = await response.json();
      console.log(data);
      setFeedbackData(data); // Assuming setFeedbackData is defined elsewhere
    } catch (error) {
      console.error("Error fetching data:", error);
    }
  };

  return (
    <div>
      <h1>Feedback</h1>
      <div>
        {feedbackData.map((feedback, index) => (
          <div key={index}>
            <p>
              {" "}
              <strong>Serial:</strong> {feedback.serial}
            </p>
            <p>
              {" "}
              <strong>Zone:</strong> {feedback.zone}
            </p>
            <p>
              <strong>Division:</strong> {feedback.division}
            </p>
            <p>
              <strong>Department:</strong> {feedback.deptt}
            </p>
            <p>
              <strong>Date:</strong> {feedback.date}
            </p>
            <p>
              <strong>Message:</strong> {feedback.message}
            </p>
            <p>
              <strong>Message By:</strong> {feedback.message_by}
            </p>
            <p>
              <strong>Level:</strong> {feedback.level}
            </p>
            <hr />
          </div>
        ))}
      </div>
    </div>
  );
}

export default ShowFeedback;
